						["custom"] = "function(states, event, arg1, ...)\n    if event == \"OPTIONS\" then\n        local name, _, icon = GetSpellInfo(aura_env.config.spellid)\n        local value = UnitHealthMax(\"player\")\n        states[\"\"] = {\n            name = name,\n            icon = icon,\n            value = value*0.75,\n            total = value,\n            percent = string.format(\"%.1f%%\", (value*0.75)/value*100),\n            progressType = \"static\",\n            autoHide = false,\n            changed = true,\n            show = true,\n        }\n        return true\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local message, _, srcGUID, srcName, _, _, destGUID, destName, _, _, spellid = ...\n        \n        if message == \"SPELL_SUMMON\"\n        and srcGUID == WeakAuras.myGUID\n        and spellid == aura_env.config.spellid\n        then\n            local value = UnitHealthMax(\"player\")\n            local name, _, icon = GetSpellInfo(aura_env.config.spellid)\n            aura_env.destGUID = destGUID\n            aura_env.max = value\n            states[destGUID] = {\n                name = name,\n                icon = icon,\n                value = value,\n                total = value,\n                percent = string.format(\"%.1f%%\", value/value*100),\n                progressType = \"static\",\n                autoHide = false,\n                changed = true,\n                show = true,\n            }\n        elseif states[destGUID] then\n            local state = states[destGUID]\n            local subEvents = aura_env.subEvents\n            if subEvents[message] then\n                state.value = subEvents[message](state.value, ...)\n                state.percent = string.format(\"%.1f%%\", state.value/state.total*100)\n                state.changed = true\n                state.show = true\n            end\n        end\n    end\n    \n    if event == \"EARTH_TOTEM_UPDATE\" and arg1 and states[arg1] then\n        aura_env.destGUID = nil\n        aura_env.max = 0\n        states[arg1].show = false\n        states[arg1].changed = true\n    end\n    \n    if event == \"PLAYER_TARGET_CHANGED\" and UnitExists(\"target\") and aura_env.destGUID and states[aura_env.destGUID] then\n        local state = states[aura_env.destGUID]\n        if UnitGUID(\"target\") == aura_env.destGUID then\n            state.value, state.total = UnitHealth(\"target\"), UnitHealthMax(\"target\")\n            state.percent = string.format(\"%.1f%%\", state.value/state.total*100)\n            state.changed = true\n            state.show = true\n        elseif UnitGUID(\"targettarget\")==aura_env.destGUID then\n            state.value, state.total = UnitHealth(\"targettarget\"), UnitHealthMax(\"targettarget\")\n            state.percent = string.format(\"%.1f%%\", state.value/state.total*100)\n            aura_env.max = state.total\n            state.changed = true\n            state.show = true\n        end\n    end\n    \n    return true\nend",
