					["colorG"] = 1,
					["alphaFunc"] = "function(progress, start, delta)\n    if aura_env.state and aura_env.state.show and aura_env.state.unitid then\n        if aura_env.flag then\n            aura_env.flag = false\n            aura_env.sortAndOffset()\n        end\n        \n        local c = aura_env.config\n        local unit = aura_env.state.unitid\n        local status = aura_env.state.status\n        \n        if (c.visible and status == \"FAR\") or --hide not visible\n        (c.dead and status == \"DEAD\") or --hide dead\n        (c.offline and status == \"OFFLINE\") then --hide offline\n            return 0\n        end\n        \n        if c.setAlpha then\n            if unit ~= \"player\" and (status == \"FAR\" or status == \"OFFLINE\" or status == \"DEAD\" or WeakAuras.CheckRange(unit, 40, \">\")) then\n                return c.Alpha\n            end\n        end\n        \n        return 1\n    end\n    return 1\nend",
