				["init"] = {
					["do_custom"] = true,
					["custom"] = "\naura_env.Buffs = {\n    [1459] = \"MAGE\",\n    [21562] = \"PRIEST\",\n}\n\naura_env.Items = {\n    [5512] = \"WARLOCK\",\n    [113509] = \"MAGE\",\n}\n\nfunction UnitHasBuff(unit, id)\n    local i = 1\n    local name, rank, icon, count, debuffType, duration, expirationTime, unitCaster, isStealable, \n    spellId = UnitBuff(unit, i)\n    while spellId do\n        --print(\"Buffid \"..spellId)\n        if(spellId == id) then\n            return true\n        end\n        i = i + 1\n        name, rank, icon, count, debuffType, duration, expirationTime, unitCaster, isStealable, \n        spellId = UnitBuff(unit, i)\n    end\n    --print(\"Buff not found...\")\n    return false\nend\n\nfunction IsAbleToDo(unit, clName, id)\n    local localizedClass, englishClass, classIndex = UnitClass(unit)\n    if(clName ~= englishClass) then\n        return false\n    end\n    print(\"Checking \"..UnitName(unit))\n    if(UnitPhaseReason(unit) ~= nil) then\n        print(UnitName(unit)..\" is not phase...\")\n        return false\n    elseif(UnitIsDeadOrGhost(unit)) then\n        print(UnitName(unit)..\" is dead...\")\n        return false\n    elseif(WeakAuras.CheckRange(unit, 40, \">=\")) then\n        print(UnitName(unit)..\" is not in range...\")\n        return false\n    end\n    return true\nend\n\nfunction DoIHaveItem(id)\n    for i = 0, NUM_BAG_SLOTS do\n        for z = 1, GetContainerNumSlots(i) do\n            if GetContainerItemID(i, z) == id then\n                return true\n            end\n        end\n    end\n    return false\nend",
