						["custom"] = "function(event, ...)\n    if(event == \"OPTIONS\") then\n        return\n    end\n    -- Handle Buffs\n    for id,class in pairs(aura_env.Buffs) do\n        print(GetSpellLink(id)..\" is buffed by \"..class)\n        if(not UnitHasBuff(\"player\",id)) then\n            print(\"Let's see who can buff it...\")\n            local players = {}\n            for unit in WA_IterateGroupMembers() do\n                if(IsAbleToDo(unit, aura_env.Buffs[id], id)) then\n                    local name, realm = UnitName(unit)\n                    if(realm) then\n                        print(name..\"-\"..realm.. \"should buff \"..GetSpellLink(id))\n                        table.insert(players,name..\"-\"..realm)\n                    else\n                        print(name..\" should buff \"..GetSpellLink(id))\n                        table.insert(players,name)\n                    end\n                    break\n                end\n            end\n            if(#players > 0) then\n                local r = math.random(1,#players)\n                print(\"Number is \"..r)\n                local p = players[r]\n                SendChatMessage(\"Hey! could you please buff \"..GetSpellLink(id)..\"? \",\"WHISPER\", nil, p)\n            end\n        else\n            print(\"I have \"..GetSpellLink(id)..\" already.\")\n        end\n    end\n    -- Handle Items\n    for id,class in pairs(aura_env.Items) do\n        local itemName, itemLink, itemRarity, itemLevel, itemMinLevel, itemType, itemSubType, itemStackCount, itemEquipLoc, itemTexture, itemSellPrice = GetItemInfo(id)\n        print(itemLink..\" should come from \"..class)\n        if(not DoIHaveItem(id)) then\n            print(\"Let's see who can give it...\")\n            local players = {}\n            for unit in WA_IterateGroupMembers() do\n                if(IsAbleToDo(unit, aura_env.Items[id], id)) then\n                    local name, realm = UnitName(unit)\n                    if itemLink then\n                        print(name..\"-\"..realm..\" should give \"..itemLink)\n                    else\n                        print(name..\"-\"..realm..\" should give \"..id)\n                        end\n                        SendChatMessage(\"Hey! could you please give me some \"..itemLink..\"? \",OFFICER)\n                        table.insert(players,name..\"-\"..realm)\n                        break\n                    end\n                end\n            else\n                print(\"I have \"..itemLink)\n            end\n        end\n    end",
